import React from 'react'
import phone from './images/phone.png'
import mail from './images/Mail.png'

export default function Contact(props){
  console.log(props.contacts.status)
  let badgeName
  if(props.contacts.status === 0){
    badgeName = "CEO"
  }else if(props.contacts.status === 1){
    badgeName = "Developer"
  }else if(props.contacts.status === 2){
    badgeName = "Tester"
  }

  return(
    <div className="contact-card">

      {badgeName && <div className='card-badge'>{badgeName}</div>}
            <img src={props.contacts.img} alt=""/>
            <h3>{props.contacts.name}</h3>
            <div className="info-group">
                <img src={phone} alt=''/>
                <p>{props.contacts.phone}</p>
            </div>
            <div className="info-group">
                <img src={mail} alt=''/>
                <p>{props.contacts.email}</p>
            </div>
        </div>
  )
}
